import React from 'react'

const Footer = () => {
  return (
    <footer class="bg-dark text-center text-lg-start footer">
      <div class="text-center p-3" style={{ backgroundColor: "rgba(0, 0, 0, 0.2)" }}>
        <a class="text-light" href="">Mujahid.com</a>
      </div>
    </footer>
  )
}

export default Footer;
